import Modal from "@mui/material/Modal";
import React from "react";

const UIModal = ({ open, onClose, children }) => {
  return (
    <Modal open={open} onClose={onClose}>
      <Box>{children}</Box>
    </Modal>
  );
};

export default UIModal;
